import React from 'react';
import HomePage from './pages/homepage/homepage.component';
import { Route } from 'react-router-dom'
import './App.css';

function App() {
  return (
    <div className="App">
        <Route exact path="/" component={HomePage}></Route>
    </div>
  );
}

export default App;
